questionvariables.text:
a1:rand_with_prohib(-6,4,[0]);
b1:rand_with_prohib(a1+1,6,[-a1,0]);

quest:expand((x-a1)*(x-b1));

ta1_ta2:(x-a1)*(x-b1);

ta3:x<a1;
ta4:x>b1;



/*--------------------------------------------------------------------------------------------*/
/*Define function S(n) that given a number n, returns the string "+n" if positive (or zero) and "-n" if negative, if n=+1 or -1 it returns + or - respectively*/

S(n):= block([], if (n=1) then return("+") elseif (n=-1) then return("-") elseif (n>=0) then return(vconcat("+", abs(n)))  else  return(vconcat("-", abs(n))));

/*Define function S1(n) that given a number n, returns the string "+n" if positive (or zero) and "-n" if negative (1 and -1 are treated as the other numbers)*/

S1(n):= block([], if (n>=0) then return(vconcat("+", abs(n)))  else  return(vconcat("-", abs(n))));

/*Define function SP(n) that given a number n, returns the string "n" if positive (or zero) and "(-n)" if negative*/

SP(n):= block([], if (n>=0) then return(n)  else  return(vconcat("(-", abs(n), ")")));

/*----------------------------------------------------------------------------------------------------*/
/*wrong factorisations*/
wr_sign_1:(x+a1)*(x-b1);
wr_sign_2:(x-a1)*(x+b1);
wr_sign_12:(x+a1)*(x+b1);

/*coefficients of quadratic*/
c1:coeff(quest,x,1);
c0:coeff(quest,x,0);


set_sols:{ta3,ta4}; /*set of solutions for ans3 and ans4*/
set_student_sol: {ta3,ta4};

feedbackvariables.text:
/*carrying mistake from part a*/
s_roots: solve(ans5=0,x);
mm: multiplicities[1];
s_root_1:rhs(s_roots[1]);
s_root_2:if mm=1 then rhs(s_roots[2]) else s_root_1;
left_x: if s_root_1<s_root_2 then s_root_1 else s_root_2;
right_x: if s_root_1<s_root_2 then s_root_2 else s_root_1;

/*coefficient of quadratic term*/
sa_c2:coeff(expand(ans5),x,2);
set_consistent_answer: if sa_c2>0 then set(x<left_x, x>right_x) else set(x>left_x, x<right_x) 



/*inequalities wrong  way round*/
set_wr_ineq:set(x<b1,x>a1);

/*inequalities wrong  sign*/
set_wr_sign:if abs(a1)<abs(b1) then set(x<-a1,x>b1) else set(x<a1,x>-b1);
